import React, { useState } from 'react';
import axios from 'axios';
import { Chess } from 'chess.js'; // Ensure chess.js is available client-side
import AnalysisBoard from './AnalysisBoard';
import { Link } from 'react-router-dom';
import './styles.css'; // Ensure this import path is correct



// Import both logo images
import logo from './squarechesslogolong.png'; // Adjust the path as needed
import logoWhite from './squarechesslogolongwhite.png'; // Adj

const ImportGames = () => {
  const [file, setFile] = useState(null);
  const [uploadStatus, setUploadStatus] = useState('');
  const [gamesList, setGamesList] = useState([]);
  const [selectedGame, setSelectedGame] = useState(null);
  const [isLogoHovered, setIsLogoHovered] = useState(false);
  const displayGameDetails = (pgn) => {
    const chess = new Chess();
    chess.loadPgn(pgn);
    // Extracting details: Adjust based on actual PGN content and your needs
    const headers = chess.header();
    return `${headers.White} vs ${headers.Black}, ${headers.Result}, ${headers.Date}`;
  };

  const handleFileChange = (e) => {
    setFile(e.target.files[0]);
  };

  const handleUpload = async (e) => {
    e.preventDefault();
    if (!file) {
      setUploadStatus('Please select a file to upload.');
      return;
    }


    const reader = new FileReader();
    reader.onload = async (e) => {
      const text = e.target.result;
      const chess = new Chess();
      chess.loadPgn(text);

      if (!chess.pgn()) {
        setUploadStatus('Invalid PGN file. Please upload a valid PGN file.');
        return;
      }
      try {
        const response = await axios.post('http://localhost:3001/api/games/process', { pgn: text }, {
          headers: {
            'Content-Type': 'application/json',
          },
        });
        setGamesList(response.data);
        setUploadStatus('File processed successfully!');
      }  catch (error) {
        if (error.response) {
          console.log(error.response.data); // Detailed error from server
          setUploadStatus(error.response.data || 'An error occurred during file processing.');
        } else {
          setUploadStatus('An error occurred during file upload.');
        }
      }


    };
    reader.readAsText(file); // Read the file as text
  };

  // Render the list of games and allow the user to select one
return (

    <div className="import-games-container">
        <header>
                <nav>
                    <ul>
                        <li onMouseEnter={() => setIsLogoHovered(true)}
                            onMouseLeave={() => setIsLogoHovered(false)}>
                            <Link to="/">
                                <img src={isLogoHovered ? logoWhite : logo} alt="Home" style={{height: '40px' }} />
                            </Link>
                        </li>
                        <li><Link to="/" className="prepare-link">Prepare</Link></li>
                        <li><Link to="/analysis-board">Analysis Board</Link></li>
                        <li><Link to="/import-games">Import Games</Link></li>
                        <li><Link to="#about-us">About Us</Link></li>
                    </ul>
                </nav>
            </header>
      <form onSubmit={handleUpload}>
        <input type="file" onChange={handleFileChange} />
        <button type="submit">Upload</button>
        {uploadStatus && <p>{uploadStatus}</p>}
      </form>
      <div>
      <div className="games-list">
      {gamesList.map((pgn, index) => (
          <div key={index} className="game-item" onClick={() => setSelectedGame(pgn)}>
            {displayGameDetails(pgn)}
          </div>
        ))}
      </div>
      </div>
      <div className="analysis-board-container">
      {selectedGame && (
    <AnalysisBoard fen="start" pgn={selectedGame} >{({evaluation, bestLine, goToEnd, goToNextMove, goToPreviousMove, goToStart}) => (
        <div>
            <button onClick={goToStart}>Start</button>
            <button onClick={goToPreviousMove}>Previous</button>
            <button onClick={goToNextMove}>Next</button>
            <button onClick={goToEnd}>End</button>
            <div>
                <div>Stockfish Eval: {evaluation}</div>
                <div>Best Continuation Line: {bestLine}</div>
            </div>
            </div> 
    )}</AnalysisBoard>

    // Assuming `selectedGame` has a `pgn` property
)}
    </div>
    </div>
  );
};

export default ImportGames;
